  { path: 'delete-object', component: DeleteObjectComponent },
  { path: 'q1', component: DeleteObjectComponent },
  { path: 'q2', component: DeleteObjectComponent },
  { path: 'q3', component: DeleteObjectComponent },
  { path: 'delete-object', component: DeleteObjectComponent },
  { path: 'delete-object', component: DeleteObjectComponent },
  { path: 'delete-object', component: DeleteObjectComponent },

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
